package com.qtz.sm.search.vo;import com.mall.core.vo.VO;/** * <p>Title:SearchList</p> * <p>Description:搜索列表VO类</p> * <p>Copyright: Copyright (c) 2016</p> * <p>Company: 深圳市擎天柱信息科技有限公司</p> * @author 郭云龙- 252735833@qq.com * @version v1.0 2016-06-06 */public class SupeGoodsSearch extends VO<Long> implements java.io.Serializable {		/**类的版本号*/	private static final long serialVersionUID = 1694503164479488L;	/** SKU个数 */	private Long skuNum;	/** 商品ID */	private Long goodsId;	/** 价格 */	private Double price;	/** 商品名称 */	private String goodsName;	/** 商品状态 0未审核，1审核通过，2审核未通过，3上架，4下架 */	private Integer status ;	/** 商品图片 */	private String picURL;	public Long getSkuNum() {		return skuNum;	}	public void setSkuNum(Long skuNum) {		this.skuNum = skuNum;	}	public Long getGoodsId() {		return goodsId;	}	public void setGoodsId(Long goodsId) {		this.goodsId = goodsId;	}	public Double getPrice() {		return price;	}	public void setPrice(Double price) {		this.price = price;	}	public String getGoodsName() {		return goodsName;	}	public void setGoodsName(String goodsName) {		this.goodsName = goodsName;	}	public Integer getStatus() {		return status;	}	public void setStatus(Integer status) {		this.status = status;	}	public String getPicURL() {		return picURL;	}	public void setPicURL(String picURL) {		this.picURL = picURL;	}}